import About from './About.js';
import Contact from './Contact.js';
import Service from './Service.js';
import Blogs from './Blogs.js';


import './App.css';
function App() {
  return (
    <>
     <Home/>
    <About/>
    <Service/>
    <Blogs/>
    <Contact/>
    </>
  )
  ;}
export default App;
